        <Box sx={{height:'200px', width: '50%', bgcolor: 'black', m:"auto", mt:20 }}>
            <Box sx={{width:'50%', m:"auto", pt:"10px"}} >
                <Typography variant="h6" sx={{ color : "white"}}>Loading For Data ...</Typography>
                <CircularProgress />
            </Box>
        </Box>
    )
}

export default Loading
